xplicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=36869\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:448:\"Zapraszamy na WordCamp Wrocław 2024, który odbędzie się w dniach 22-24 listopada 2024 roku we Wrocławiu!  To wyjątkowe wydarzenie skupiające społeczność WordPressa – zarówno tych, którzy dopiero zaczynają swoją przygodę, jak i zaawansowanych specjalistów. W tym roku WordCamp Wrocław oferuje trzy ścieżki (jedną dla początkujących), więc każdy znajdzie coś dla siebie!  Chcesz mieć realny wpływ na rozwój [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Katka\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1581:\"\n<p><strong>Zapraszamy na <a href=\"https://wroclaw.wordcamp.org/2024/\">WordCamp Wrocław 2024</a>, który odbędzie się w dniach 22-24 listopada 2024 roku we Wrocławiu! </strong></p>\n\n\n\n<p>To wyjątkowe wydarzenie skupiające społeczność WordPressa – zarówno tych, którzy dopiero zaczynają swoją przygodę, jak i zaawansowanych specjalistów. W tym roku WordCamp Wrocław oferuje <strong>trzy ścieżki (jedną dla początkujących)</strong>, więc każdy znajdzie coś dla siebie! </p>\n\n\n\n<p>Chcesz mieć realny wpływ na rozwój WordPressa?&nbsp;<strong>Contributor Day (22.11.2024)</strong>&nbsp;to idealna szansa, aby dowiedzieć się, jak możesz wspierać ten projekt od środka. To dzień wypełniony praktycznymi działaniami, podczas którego nie tylko zdobędziesz cenne umiejętności, ale także od razu zaangażujesz się w rozwój platformy!</p>\n\n\n\n<p>WordCamp to znacznie więcej niż wykłady i warsztaty. To także doskonała okazja do nawiązania kontaktów z innymi miłośnikami WordPressa. Wieczorne imprezy integracyjne będą świetnym momentem, by pogłębić nowe znajomości i wymienić się doświadczeniami w swobodnej, przyjaznej atmosferze.&nbsp;</p>\n\n\n\n<p>Nie przegap tej szansy! Zarezerwuj swoje miejsce już teraz:<br><strong>Bilety</strong> -&gt; <a href=\"https://wroclaw.wordcamp.org/2024/bilety/\">https://wroclaw.wordcamp.org/2024/bilety/</a> (dla studentów niższa cena)</p>\n\n\n\n<p>Czekamy na Ciebie we Wrocławiu na&nbsp;<strong>WordCamp 2024</strong>! Dołącz do nas i bądź częścią tej wyjątkowej społeczności!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://pl.wordpress.org/2024/10/11/wordcamp-wroclaw-polska-2024/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"36869\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"WordCamp Gdynia, Polska 2024\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://pl.wordpress.org/2024/05/14/wordcamp-gdynia-2024/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://pl.wordpress.org/2024/05/14/wordcamp-gdynia-2024/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 May 2024 21:15:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=33703\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:431:\"Zapraszamy na WordCamp Gdynia 2024, który odbędzie się w dniach 4-6 października 2024 roku w Gdyni (PL)! To wyjątkowa konferencja, która skupia społeczność WordPressa. Jest to wydarzenie dla każdego, od początkujących użytkowników, po zaawansowanych deweloperów. W tym roku będziemy zgłębiać tematy związane z najnowszymi trendami i technologiami w świecie WordPressa, w tym optymalizacją pracy oraz [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1596:\"\n<p><strong>Zapraszamy na <a href=\"https://gdynia.wordcamp.org/2024/\" data-type=\"link\" data-id=\"https://gdynia.wordcamp.org/2024/\">WordCamp Gdynia 2024</a>, który odbędzie się w dniach 4-6 października 2024 roku w Gdyni (PL)!</strong></p>\n\n\n\n<p>To wyjątkowa konferencja, która skupia społeczność WordPressa. Jest to wydarzenie dla każdego, od początkujących użytkowników, po zaawansowanych deweloperów. W tym roku będziemy zgłębiać tematy związane z najnowszymi trendami i technologiami w świecie WordPressa, w tym optymalizacją pracy oraz samej platformy.</p>\n\n\n\n<p>Na WordCamp Gdynia 2024 czeka na Was mnóstwo inspirujących prezentacji, warsztatów oraz sesji networkingowych. Spotkacie pasjonatów WordPressa, którzy podzielą się swoją wiedzą i doświadczeniem, a także poznacie nowe osoby, z którymi będziecie mogli wymienić się pomysłami i nawiązać cenne kontakty zawodowe.</p>\n\n\n\n<p>Podczas konferencji poruszymy szerokie spektrum tematów, od tworzenia stron internetowych, przez SEO i marketing, po projektowanie i zarządzanie treścią. To doskonała okazja, aby dowiedzieć się więcej o najnowszych trendach i narzędziach, które mogą pomóc w codziennej pracy z WordPressem.</p>\n\n\n\n<p>Nie przegapcie tej okazji! Już teraz dostępne są bilety early birds w cenie 50 zł. Zarezerwujcie swoje miejsce na stronie: <a href=\"https://gdynia.wordcamp.org/2024/\">https://gdynia.wordcamp.org/2024/</a></p>\n\n\n\n<p>Czekamy na Was w Gdyni na WordCamp 2024! Dołączcie do społeczności WordPressa i bądźcie częścią tego wyjątkowego wydarzenia.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://pl.wordpress.org/2024/05/14/wordcamp-gdynia-2024/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0: