odbędzie się 11 maja 2024 o godz. 12:00 📅. Poprzednia edycja, która miała miejsce 2 marca 2024 w Muzeum Miasta Gdyni 🏛, zgromadziła 120 pasjonatów WordPressa, oferując 11 merytorycznych prezentacji i dużą dawkę wiedzy na [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8890:\"\n<p>Cześć!</p>\n\n\n\n<p>Właśnie skończyła się 20. edycja WordUp Trójmiasto <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f389.png\" alt=\"🎉\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />, a my już nie możemy się doczekać kolejnej, 21. edycji, która odbędzie się 11 maja 2024 o godz. 12:00 <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f4c5.png\" alt=\"📅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. </p>\n\n\n\n<p>Poprzednia edycja, która miała miejsce 2 marca 2024 w Muzeum Miasta Gdyni <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f3db.png\" alt=\"🏛\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />, zgromadziła 120 pasjonatów WordPressa, oferując 11 merytorycznych prezentacji i dużą dawkę wiedzy na temat designu, SEO, marketingu i tworzenia treści <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f913.png\" alt=\"🤓\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. Była to niepowtarzalna okazja do spotkania z ludźmi z branży, wymiany doświadczeń i nawet znalezienia przyszłego współpracownika czy klienta <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f465.png\" alt=\"👥\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />.</p>\n\n\n\n<p>Dlaczego warto już teraz zaplanować swoją obecność na <a href=\"https://wp.trojmiasto.us/#rejestracja\">WordUp Trójmiasto #21</a>? Jeśli poprzednia edycja jest jakimkolwiek wyznacznikiem, możemy się spodziewać jeszcze więcej inspirujących prezentacji <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />, spotkań z ekspertami i możliwości do networkingu <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f91d.png\" alt=\"🤝\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. To szansa nie tylko na zdobycie nowej wiedzy, ale również na spotkanie z innymi entuzjastami WordPressa, co jest bezcenne w naszej branży.</p>\n\n\n\n<p>Edycja #21 to kolejna okazja do zanurzenia się w świat WordPressa i poszerzenia swoich horyzontów <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f680.png\" alt=\"🚀\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. Niezależnie od tego, czy jesteś deweloperem, projektantem, specjalistą SEO, czy pasjonatem tworzenia treści, znajdziesz coś dla siebie. Networking na steroidach, jak to było podczas poprzedniej edycji, zapewni możliwość nawiązania nowych kontaktów biznesowych i wymiany doświadczeń z innymi uczestnikami <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f4bc.png\" alt=\"💼\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />.</p>\n\n\n\n<p>Zachęcamy do wcześniejszej rejestracji, aby lepiej zorganizować wydarzenie <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. Wszystkie szczegóły dotyczące rejestracji i więcej informacji na temat samego wydarzenia znajdziecie na naszej stronie na Facebooku oraz na oficjalnej stronie wydarzenia <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f310.png\" alt=\"🌐\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />.</p>\n\n\n\n<p>Nie przegap tej wyjątkowej okazji do spotkania z entuzjastami WordPressa, odkrywania nowych inspiracji i zgłębiania wiedzy! Do zobaczenia 11 maja! <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f388.png\" alt=\"🎈\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Pozdrawiam serdecznie, <br>Mariusz Szatkowski Organizator WordUp Trójmiasto</p>\n\n\n\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped wp-block-gallery-1 is-layout-flex wp-block-gallery-is-layout-flex\">\n<figure class=\"wp-block-image size-large\"><a href=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-scaled.jpg\"><img fetchpriority=\"high\" decoding=\"async\" width=\"1024\" height=\"768\" data-id=\"22876\" src=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-1024x768.jpg\" alt=\"\" class=\"wp-image-22876\" srcset=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-1024x768.jpg 1024w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-300x225.jpg 300w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-768x576.jpg 768w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-1536x1152.jpg 1536w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-2048x1536.jpg 2048w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-scaled.jpg\"><img decoding=\"async\" width=\"1024\" height=\"768\" data-id=\"22877\" src=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-1024x768.jpg\" alt=\"\" class=\"wp-image-22877\" srcset=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-1024x768.jpg 1024w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-300x225.jpg 300w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-768x576.jpg 768w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-1536x115