5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:399:\"🗓️ Data: 2 marca 2024📍 Lokalizacja: Muzeum Miasta Gdyni Zaplanuj już dziś swoją wizytę nad morzem i dołącz do nas na 20. edycji WordUp Trójmiasto! Jeśli WordPress jest Twoją pasją, to to wydarzenie jest stworzone właśnie dla Ciebie!10 merytorycznych prezentacji i duża dawka wiedzy to powody dla którego powinieneś odwiedzić wczesną wiosną Gdynię. Dlaczego warto [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2949:\"\n<p><br><img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f5d3.png\" alt=\"🗓\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Data: 2 marca 2024<br><img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f4cd.png\" alt=\"📍\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Lokalizacja: Muzeum Miasta Gdyni</p>\n\n\n\n<p>Zaplanuj już dziś swoją wizytę nad morzem i dołącz do nas na 20. edycji WordUp Trójmiasto! Jeśli WordPress jest Twoją pasją, to to wydarzenie jest stworzone właśnie dla Ciebie!<br>10 merytorycznych prezentacji i duża dawka wiedzy to powody dla którego powinieneś odwiedzić wczesną wiosną Gdynię.</p>\n\n\n\n<p><strong>Dlaczego warto przyjechać?</strong></p>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f465.png\" alt=\"👥\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> <strong>Spotkanie z Ludźmi z Branży</strong>: To niepowtarzalna okazja, aby spotkać innych entuzjastów WordPressa, wymienić się doświadczeniami, a może nawet znaleźć przyszłego współpracownika czy klienta.</p>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> <strong>Wiedza prosto od Ekspertów</strong>: Przygotowaliśmy dla Was szereg inspirujących prezentacji, które obejmują różnorodne tematy – od designu, poprzez SEO, po marketing i tworzenie treści. Każdy, bez względu na swoje doświadczenie, znajdzie coś dla siebie.</p>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f91d.png\" alt=\"🤝\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> <strong>Networking na Steroidach</strong>: Po prezentacjach zapraszamy do udziału w sesjach networkingowych. To czas, kiedy możecie porozmawiać z innymi uczestnikami, podzielić się swoimi doświadczeniami i dowiedzieć się, co nowego dzieje się w świecie WordPressa.</p>\n\n\n\n<p><strong>Jak się zapisać?</strong></p>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Wstęp na wydarzenie jest darmowy, ale dla lepszej organizacji prosimy o wcześniejszą rejestrację. Zapisy można dokonać tutaj: <a href=\"https://wp.trojmiasto.us/#rejestracja\">Rejestracja na WordUp Trójmiasto #20</a></p>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f50d.png\" alt=\"🔍\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Więcej szczegółów znajdziecie na naszej stronie na Facebooku oraz na stronie wydarzenia: <a href=\"https://wp.trojmiasto.us/\">https://WP.TROJMIASTO.US</a>.</p>\n\n\n\n<p>Nie przegap tej wyjątkowej okazji do spotkania z entuzjastami WordPressa, odkrywania nowych inspiracji i zgłębiania wiedzy!</p>\n\n\n\n<p>Do zobaczenia 2 marca 2024 o godz. 12.00 w Muzeum Miasta Gdyni!</p>\n\n\n\n<p>Pozdrawiam,<br>Mariusz Szatkowski<br>Organizator WordUp Trójmiasto</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://pl.wordpress.org/2023/12/08/wordup-trojmiasto-20-2-marca-2024/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"18363\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"WordUp Trójmiasto #19 – 2 grudnia 2023\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://pl.wordpress.org/2023/10/11/wordup-trojmiasto-19-2-grudnia-2023/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://pl.wordpress.org/2023/10/11/wordup-trojmiasto-19-2-grudnia-2023/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 11 Oct 2023 06:05:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=17362\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:391:\"Już 2 grudnia 2023 roku w Muzeum Miasta Gdyni odbędzie się 19. edycja WordUp Trójmiasto. Jeśli jesteś fanem WordPressa, to musisz tam być! Dlaczego warto się wybrać? Jak się zapisać? Wstęp na wydarzenie jest darmowy, ale żebyśmy wiedzieli, ilu nas będzie, prosimy o wcześniejszą rejestrację. Możesz to zrobić tutaj: Rejestracja na WordUp Trójmiasto #19 Więcej [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1931:\"\n<p>Już 2 grudnia 2023 roku w Muzeum Miasta Gdyni odbędzie się 19. edycja WordUp Trójmiasto. Jeśli jesteś fanem WordPressa, to musisz tam być!</p>\n\n\n\n<p><strong>Dlaczego warto się wybrać?</strong></p>\n\n\n\n<ol class=\"wp-block-list\">\n<li><strong>Spotkasz Ludzi z Branży</strong>: To idealne miejsce, żeby poznać innych pasjonatów WordPressa, wymienić się doświadczeniami i nawiązać nowe kontakty. Kto wie, może znajdziesz tu swojego przyszłego współpracownika lub klienta?</li>\n\n\n\n<li><strong>Wiedza prosto od Ekspertów</strong>: Na WordUp Trójmiasto będziemy mieli aż 10 różnorodnych prezentacji. Od designu, przez SEO, aż po marketing i tworzenie treści. Każdy znajdzie coś dla siebie.</li>\n\n\n\n<li><strong>Dla Każdego Coś Miłego</strong>: Niezależnie od tego, czy jesteś początkującym użytkownikiem WordPressa, czy zaawansowanym deweloperem, każdy znajdzie tu coś dla siebie.</li>\n\n\n\n<li><strong>Networking na Steroidach</strong>: Po prezentacjach nie zapomnijmy o networkingu. To czas, kiedy możesz porozmawiać z innymi uczestnikami, wymienić się doświadczeniami i dowiedzieć się, co nowego w świecie WordPressa.</li>\n</ol>\n\n\n\n<p><strong>Jak się zapisać?</strong></p>\n\n\n\n<p>Wstęp na wydarzenie jest darmowy, ale żebyśmy wiedzieli, ilu nas będzie, prosimy o wcześniejszą rejestrację. Możesz to zrobić tutaj: <a href=\"https://evenea.pl/pl/wydarzenie/wordup19\">Rejestracja na WordUp Trójmiasto #19</a></p>\n\n\n\n<p>Więcej szczegółów znajdziesz na naszej stronie na Facebooku oraz na stronie wydarzenia <a href=\"https://wp.trojmiasto.us/\">https://WP.TROJMIASTO.US</a>.</p>\n\n\n\n<p>Nie przegap tej okazji i dołącz do nas 2 grudnia 2023 o godz. 12.00 w Muzeum Miasta Gdyni. Czekają na Ciebie ciekawe prezentacje, nowe znajomości i mnóstwo wiedzy do zgarnięcia!</p>\n\n\n\n<p>Do zobaczenia!</p>\n\n\n\n<p>Pozdrawiam, <br>Mariusz Szatkowski <br>Organizator WordUp Trójmiasto</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://pl.wordpress.org/2023/10/11/wordup-trojmiasto-19-2-grudnia-2023/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17362\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WordCamp Gdynia {NextGen} – 30.09.2023\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://pl.wordpress.org/2023/05/22/30-09-2023-wordup-gdynia-19-andrzeju-nie-denerwuj-sie/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://pl.wordpress.org/2023/05/22/30-09-2023-wordup-gdynia-19-andrzeju-nie-denerwuj-sie/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 22 May 2023 17:17:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=16179\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:423:\"Zapraszamy na najbliższe spotkanie WordCamp Gdynia 2023 NextGen, które odbędzie się w Gdyni 30 września 2023 w Gdyni. WordUp Gdynia 2023 to konferencja konferencji, która skupia społeczność WordPressa. Jest to wydarzenie dedykowane zarówno dla osób początkujących, jak i zaawansowanych użytkowników WordPressa. W tym roku będziemy rozmawiać o optymalizacji naszej pracy jak i samego WordPressa To [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2928:\"\n<figure class=\"wp-block-image size-full\"><a href=\"https://pl.wordpress.org/files/2023/05/wordup-trojmiasto.jpeg\"><img loading=\"lazy\" decoding=\"async\" width=\"960\" height=\"720\" src=\"https://pl.wordpress.org/files/2023/05/wordup-trojmiasto.jpeg\" alt=\"\" class=\"wp-image-16180\" srcset=\"https://pl.wordpress.org/files/2023/05/wordup-trojmiasto.jpeg 960w, https://pl.wordpress.org/files/2023/05/wordup-trojmiasto-300x225.jpeg 300w, https://pl.wordpress.org/files/2023/05/wordup-trojmiasto-768x576.jpeg 768w, https://pl.wordpress.org/files/2023/05/wordup-trojmiasto-440x330.jpeg 440w\" sizes=\"auto, (max-width: 960px) 100vw, 960px\" /></a></figure>\n\n\n\n<p><br><br>Zapraszamy na najbliższe spotkanie <strong>WordCamp Gdynia 2023 NextGen</strong>, które odbędzie się w Gdyni 30 września 2023 w Gdyni. </p>\n\n\n\n<p>WordUp Gdynia 2023 to konferencja konferencji, która skupia społeczność WordPressa. Jest to wydarzenie dedykowane zarówno dla osób początkujących, jak i zaawansowanych użytkowników WordPressa. W tym roku będziemy rozmawiać o optymalizacji naszej pracy jak i samego WordPressa</p>\n\n\n\n<p>To wyjątkowa okazja dla użytkowników i miłośników WordPressa, aby spotkać się, wymienić doświadczeniami i poszerzyć swoją wiedzę na temat najnowszych trendów w branży.</p>\n\n\n\n<p>Podczas WordCamp Gdynia będziemy mieli okazję spotkać się z pasjonatami WordPressa, którzy podzielą się swoimi doświadczeniami i wiedzą na temat tej platformy. Będzie to doskonała okazja do zdobycia nowych kontaktów i poznania nowych wyzwań w życiu zawodowym.</p>\n\n\n\n<p>Podczas konferencji poruszone zostaną różne tematy związane bezpośrednio i pośrednio z WordPressem, w tym tworzenie stron internetowych, SEO, marketing, projektowanie i wiele innych.</p>\n\n\n\n<p>To również doskonała okazja dla uczestników, aby podzielić się swoją wiedzą i doświadczeniami z innymi miłośnikami WordPressa.</p>\n\n\n\n<p>Podczas tego wydarzenia, będziemy mieli okazję wysłuchać aż 12 ciekawych prezentacji dotyczących WordPressa, zarówno dla deweloperów, jak i dla osób korzystających z tej platformy na co dzień. Tematyka prezentacji będzie różnorodna, choć skupiona wokół optymalizacji, obejmująca takie zagadnienia, jak design, SEO, marketing czy tworzenie treści.</p>\n\n\n\n<p>Nie zabraknie również czasu na networking, czyli nawiązywanie kontaktów i rozmowy z innymi uczestnikami spotkania. Dzięki temu można poszerzyć swoje horyzonty, dowiedzieć się czegoś nowego oraz wymienić doświadczeniami z innymi pasjonatami WordPressa.</p>\n\n\n\n<p>Wszystkie informacje na temat tego wydarzenia znajdziecie pod adresem: <a href=\"https://gdynia.wordcamp.org/2023/\">https://gdynia.wordcamp.org/2023/</a></p>\n\n\n\n<p>Nie przegap okazji, aby wziąć udział w tym niezwykłym spotkaniu, zarezerwuj swój czas już teraz i dołącz do społeczności WordPressa w Gdyni!</p>\n\n\n\n<p></p>\n\n\n\n<p></p>\n\n\n\n<p></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://pl.wordpress.org/2023/05/22/30-09-2023-wordup-gdynia-19-andrzeju-nie-denerwuj-sie/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s: